import React from "react";
// import "./Header.css ";
import logo from "../src/assets/facebook-logo.png";

function Header() {
  return (
    <div className="header">
      <div className="header__left">
        <img src="../assets" alt="" />
      </div>
      <div className="header__mid"></div>
      <div className="header__right"></div>
    </div>
  );
}

export default Header;
